import React from 'react';
import './Joul.css';
import WorkTitle from './WorkTitle/WorkTitle';
import { WorkOne, Video } from './WorkTitle/Data';
import WorkSemititle from './WorkTitle/WorkSemititle';
import {Helmet} from 'react-helmet';
import HeroSection  from '../HeroSection';
import { workObjOne } from '../HomePage/Data';
import ReactPlayer from "react-player";


function Joul() {
    return (
        <>
        <div>
        <HeroSection {...workObjOne} />
        <WorkTitle {...WorkOne} />
        </div>
        <div className="container">
            <div className="container_question">
                <span className="question">How might children explore about sustainability by themselves,<br />but not being taught?</span>
            </div>
        </div>
        <WorkSemititle {...Video} />
        <div className="container">
            <ReactPlayer url="https://vimeo.com/396714971" />
        </div>

        <div className="footer">

        </div>
        </>
    );
}

export default Joul;
